  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey's Upper Midwest
  Environmental Sciences Center (UMESC) has created high-resolution land cover/use
  data sets for selected areas in the Upper Mississippi River (UMR) from 1:15,000-scale
  color infrared aerial photos collected in 1994. These data have been interpreted
  to delineate three feature types, land cover/land use, percent of vegetation cover,
  and tree height. The areas which were photographed and interpreted are navigation
  Pools 7, 8, and 26.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
